import * as React from 'react';
import JohnZoscak from '../images/John-Zoscak.png';

import {Fade} from 'react-reveal';

const Header = (props) => {
  return (
    <header>
      <Box className='header'>
        <Fade top>
          <img src={JohnZoscak} alt='John Zoscak' />
        </Fade>
      </Box>
    </header>
  );
}
export default Header;
